import React from 'react';
import { Routes, Route, Navigate } from "react-router-dom";

import Header from "./components/header"; // Ujistěte se, že cesta k souboru je správná
import Footer from "./components/footer"; // Ujistěte se, že cesta k souboru je správná
import Game from "./components/game"; // Ujistěte se, že cesta k souboru je správná

import './App.css';
import "./Game.css";
import "./Main.css";

export default function App() {
    return (
        <>
            <Header />
            <div className="container">
              <Routes>
                <Route path="/" element={<Game />} />
                <Route path="*" element={<Navigate to="/" />} />
              </Routes>
            </div>
            <Footer />
        </>
    );
}
